import React, { Component } from 'react'
import axios from 'axios';


export default class EditBug extends Component {
    constructor(props) {
        super(props);

        this.state = {
            description: '',
            assignee: '',
            priority: '',
            completed: false
        }
    }

    render() {
        return (
            <div>
                <h1>Update a bug </h1>
            </div>
        )
    }
}
